INSERT INTO `notes__units` (`id`, `course_id`, `unit_name`, `unit_description`, `unit_application`, `unit_importantQuestions`, `unit_reference`, `unit_author_name`, `unit_author_email`, `published`, `created_at`, `updated_at`) VALUES
(1, 67, 'Unit 1 - Introduction to Intelligence and Artificial Intelligence', '<h3><span style=\"font-weight: 400;\">The first definition we see by </span><strong>Mr Elaine Rich</strong><span style=\"font-weight: 400;\"> (the author of </span><strong>&ldquo;Artificial Intelligence&rdquo;</strong><span style=\"font-weight: 400;\">).</span></h3>\r\n<p><span style=\"font-weight: 400;\">According to Elaine Rich - <em>computers are better than human beings in numerical computation, storing information for a long time and repetition of work. Humans are better than computers in understanding the concept, prediction on the basis of the pattern of system and logical reasoning.</em></span></p>\r\n<p><span style=\"font-weight: 400;\">In simple words, computers work better than humans in performing sequential tasks with fast computation. On the other side, humans work better than computers in performing tasks in a parallel manner, which is also known as <strong>parallel processing.</strong></span></p>\r\n<p><span style=\"font-weight: 400;\">Computers find difficulty in figuring out the context of input such as, &lsquo;It&rsquo;s been a long time,&rsquo;. Contextual information is important for computers to understand visual and/or speech inputs. For example, &lsquo;For a long time&rsquo; could be a few hours or could be millions of years. It depends on contextual information.</span></p>\r\n<h3><span style=\"font-weight: 400;\">The Second definition is given by<strong> Mr Buchanin</strong> and <strong>Shortliffe</strong></span></h3>\r\n<p><span style=\"font-weight: 400;\">According to Mr Buchanin and Shortliffe &ndash; <em>&ldquo;AI is the branch of computer science that deals with symbolic rather than numeric processing and non-algorithmic method including the rules of thumb or heuristics instead of algorithms as a technique for solving problems.\"</em></span></p>\r\n<p><span style=\"font-weight: 400;\"><em>Number processing deals with arithmetic operations with definite relation, whereas symbol deals with the context of having number, character, or special character to make decisions. For example, in numeric processing: 164 is greater than 28 which is true, but a 5&rsquo;7 tall person is older than a 5&rsquo;4 tall person we cannot surely say this is true.</em></span></p>\r\n<p><span style=\"font-weight: 400;\"><em>The algorithmic approach is similar to a recipe which has well-defined starting and ending points. In computers, the solution to any problem is called an algorithm.</em></span></p>\r\n<p><span style=\"font-weight: 400;\"><em>Difficult and complex problems that cannot be solved with the algorithmic approach can be solved with a non-algorithmic approach such as <strong>Neural Networks</strong>. Besides Neural Networks, there is one more approach called <strong>symbolic approach.<br /></strong></em></span></p>\r\n<p><span style=\"font-weight: 400;\">The symbolic approach works on exploitation/manipulation of the knowledge of the domain. Some of this knowledge, generally called <strong>heuristics</strong>, is in Artificial Intelligence. </span><span style=\"font-weight: 400;\">In Artificial Intelligence, <strong>guesses </strong>are called <strong>heuristics</strong>.</span></p>\r\n<h3><span style=\"font-weight: 400;\">Another definition by <strong>Mr Elaine Rich</strong></span></h3>\r\n<p><span style=\"font-weight: 400;\">According to Mr Rich &ndash; <em>Artificial Intelligence is the study of techniques for solving exponentially hard problems in polynomial time by exploiting knowledge about the problem domain.</em></span></p>\r\n<p><span style=\"font-weight: 400;\"><em>In this comment, Mr Rich was concerned about the time and space complexity of the problem, the <strong>exponential time complexity</strong> is considered as the impractical amount of time from a computation point of view whereas <strong>polynomial-time</strong> takes a reasonable amount of time which is a good alternative to exponential time.</em></span></p>\r\n<h3><span style=\"font-weight: 400;\">Definition by <strong>Mr Barr</strong> and <strong>Feigenbaum</strong></span></h3>\r\n<p><span style=\"font-weight: 400;\">According to Barr, AI is part of the computer concerned with designing an intelligent system. Systems that exhibit the characteristics we associate with intelligence in human behaviour.</span></p>\r\n<h3><span style=\"font-weight: 400;\">Definition by<strong> Mr Shalkoff</strong> </span></h3>\r\n<p><span style=\"font-weight: 400;\">According to Mr Shalkoff &ndash; <em>Artificial Intelligence is a field of study that seeks to explain and emulate intelligent behaviour in terms of computational processes.</em></span></p>\r\n<p><span style=\"font-weight: 400;\"><em>Artificial Intelligence is considered <strong>partly engineering and partly scientific.&nbsp;</strong></em></span></p>\r\n<p><span style=\"font-weight: 400;\"><em>Engineering is defined as the<strong> application of science and mathematics</strong> which is useful to man in structure, meeting some requirements and according to some specifications.</em></span></p>\r\n<p><span style=\"font-weight: 400;\"><em>In Mr Shalkoff&rsquo;s words, through the application of AI, products are obtained that exhibit intelligent behaviour, how to judge/evaluate whether a product obtained through an application of AI is actually intelligent.</em></span></p>\r\n<p><span style=\"font-weight: 400;\"><em>Mr Alan Turning suggested a <strong>Turing test</strong> is the best testing approach for AI products</em></span></p>', '<p><span style=\"font-weight: 400;\">As discussed above, the algorithmic approach has limitations that can be resolved by an Artificial Intelligence approach using symbol processing and neural networks. In general, we use artificial intelligence in pattern recognition, disease diagnosis, market value prediction, etc. Most importantly for user interaction and instant response of unstructured queries.</span></p>\r\n<p>&nbsp;</p>', '<p><strong>1. What is the purpose of the Turing test? Give a brief outline of the Turing test? What are the objections to the Turing test?&nbsp;<br /></strong><span style=\"font-weight: 400;\">The purpose of the Turing test is explained with a </span><strong>three-room story.</strong><span style=\"font-weight: 400;\"> Consider, it is claimed that a computer is intelligent which is placed in one of the three rooms. Two people are sitting in the other 2 rooms, one in each room. The person in one of the rooms is Suresh and the other is Ramesh. Ramesh asked a question to the computer as well as Suresh, without knowing to whom that particular question is being directed. The computer would answer in such a way that its identity is not revealed to Ramesh.&nbsp;<br /></span><strong>Objections to Turing test: </strong><span style=\"font-weight: 400;\">There are a number of objections for the Turing test as a test of intelligence of a machine. The most popular objection is the </span><strong>Chinese room test</strong><span style=\"font-weight: 400;\">.</span></p>\r\n<p><strong>2. What is the purpose of the Chinese Room test? Give a brief outline of this test. How did the outcomes of the Chinese Room Test contribute to the development of machine intelligence?<br /></strong><span style=\"font-weight: 400;\">Chinese room test is an objection to the Turing test. It consists of a single room having </span><strong>two windows</strong><span style=\"font-weight: 400;\">. In the first room, there is a scholar on Shakespeare, and he knows English but does not know Chinese. The scholar is sitting with a sort of encyclopedia on Shakespeare. The encyclopedia is printed in such a way, that Chinese is written on one face of the page and on the opposite face has its English translation.&nbsp;<br /></span><span style=\"font-weight: 400;\">From the first window, questions are asked to the person in the Chinese language. The scholar looks into the encyclopedia and searches for the exact match of the sequence of characters in the encyclopedia, reads its translation in English, thinks and writes the answer in English, finds the corresponding sequence of characters in Chinese and sends a sequence of Chinese characters through the other window. Although the scholar behaves as if s/he knows Chinese, but this is not the fact. Just from the fact that a system is able to simulate a quality, it cannot be inferred that it possesses the quality.</span></p>', '<p>1. <span style=\"font-weight: 400;\">For more information kindly refer to the </span><strong>IGNOU study material</strong><span style=\"font-weight: 400;\"> </span><span style=\"font-weight: 400;\"></span></p>\r\n<p><span style=\"font-weight: 400;\">2. <strong>Rich E. &amp; Knight K. (1991) Artificial Intelligence</strong></span></p>\r\n<p>&nbsp;</p>', 'Deepak', 'deepakkumaratariya@gmail.com', 1, NULL, NULL),
(3, 67, 'Unit 2 - The Propositional Logic', '<p><strong>A GLANCE AT PROPOSITIONAL LOGIC</strong></p>\r\n<p>A proposition&nbsp;is the study of&nbsp;logic. It is defined as a declarative statement that is either TRUE or FALSE. The propositional logic is defined recursively which is also known as WFF (Well Formed Formula) or formula, for example:</p>\r\n<ol>\r\n<li>If A is wff then (~A) is a wff.</li>\r\n<li>If A and B are the formula, then each of the following is wff:\r\n<ol>\r\n<li>(A ᴧ B)</li>\r\n<li>(A v B)</li>\r\n<li>(A&rarr;B)</li>\r\n<li>(A&harr;B)</li>\r\n</ol>\r\n</li>\r\n<li>Any wff is obtained only by applying the rules or operator between operands.</li>\r\n</ol>\r\n<p>It is easy to identify the incorrect formula such as:</p>\r\n<ol>\r\n<li>(P&rarr;(R ᴧ)).</li>\r\n<li>(P(R ᴧ A)).</li>\r\n</ol>\r\n<p>The mentioned above formulas are not wff because in second formula &lsquo;P&rsquo; truth value is not formulated with (R ᴧ A). The correct formula could be (P&rarr;(R ᴧ A)) or other.</p>\r\n<p>We can also eliminate or ignore parentheses by setting up the priorities in increasing order.</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: center;\" width=\"205\">\r\n<p>Priority</p>\r\n</td>\r\n<td style=\"text-align: center;\" width=\"205\">\r\n<p>Name</p>\r\n</td>\r\n<td style=\"text-align: center;\" width=\"205\">\r\n<p>Symbol</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\" width=\"205\">\r\n<p>1.</p>\r\n</td>\r\n<td style=\"text-align: center;\" width=\"205\">\r\n<p>Negation</p>\r\n</td>\r\n<td style=\"text-align: center;\" width=\"205\">\r\n<p>~</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\" width=\"205\">\r\n<p>2.</p>\r\n</td>\r\n<td style=\"text-align: center;\" width=\"205\">\r\n<p>Conjunction</p>\r\n</td>\r\n<td style=\"text-align: center;\" width=\"205\">\r\n<p>ᴧ</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\" width=\"205\">\r\n<p>3.</p>\r\n</td>\r\n<td style=\"text-align: center;\" width=\"205\">\r\n<p>Disjunction</p>\r\n</td>\r\n<td style=\"text-align: center;\" width=\"205\">\r\n<p>V</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\" width=\"205\">\r\n<p>4.</p>\r\n</td>\r\n<td style=\"text-align: center;\" width=\"205\">\r\n<p>Implication</p>\r\n</td>\r\n<td style=\"text-align: center;\" width=\"205\">\r\n<p>&rarr;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\" width=\"205\">\r\n<p>5.</p>\r\n</td>\r\n<td style=\"text-align: center;\" width=\"205\">\r\n<p>If and only if</p>\r\n</td>\r\n<td style=\"text-align: center;\" width=\"205\">\r\n<p>&harr;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>MEANING OF PROPOSITIONAL LOGIC</strong></p>\r\n<p>Please refer to the table below to find out the truth value. Notice, if we have one statement then possible interpretations will be 2<sup>1 </sup>, if two statements then interpretations will be 2<sup>2</sup> and so on.</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 428.182px; text-align: center;\">\r\n<p>S no</p>\r\n</td>\r\n<td style=\"width: 428.182px; text-align: center;\">\r\n<p>Name</p>\r\n</td>\r\n<td style=\"width: 428.182px; text-align: center;\">\r\n<p>Description</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 428.182px; text-align: center;\">\r\n<p>1.</p>\r\n</td>\r\n<td style=\"width: 428.182px; text-align: center;\">\r\n<p>Negation</p>\r\n</td>\r\n<td style=\"width: 428.182px; text-align: center;\">\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"94\">\r\n<p>A</p>\r\n</td>\r\n<td width=\"94\">\r\n<p>~A</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"94\">\r\n<p>T</p>\r\n</td>\r\n<td width=\"94\">\r\n<p>F</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"94\">\r\n<p>F</p>\r\n</td>\r\n<td width=\"94\">\r\n<p>T</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 428.182px; text-align: center;\">\r\n<p>2.</p>\r\n</td>\r\n<td style=\"width: 428.182px; text-align: center;\">\r\n<p>Conjunction</p>\r\n</td>\r\n<td style=\"width: 428.182px; text-align: center;\">\r\n<p>&nbsp;</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 142.727px;\">\r\n<p>A</p>\r\n</td>\r\n<td style=\"width: 140.909px;\">\r\n<p>B</p>\r\n</td>\r\n<td style=\"width: 126.364px;\">\r\n<p>(AᴧB)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 142.727px;\">\r\n<p>T</p>\r\n</td>\r\n<td style=\"width: 140.909px;\">\r\n<p>T</p>\r\n</td>\r\n<td style=\"width: 126.364px;\">\r\n<p>T</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 142.727px;\">\r\n<p>T</p>\r\n</td>\r\n<td style=\"width: 140.909px;\">\r\n<p>F</p>\r\n</td>\r\n<td style=\"width: 126.364px;\">\r\n<p>F</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 142.727px;\">\r\n<p>F</p>\r\n</td>\r\n<td style=\"width: 140.909px;\">\r\n<p>T</p>\r\n</td>\r\n<td style=\"width: 126.364px;\">\r\n<p>F</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 142.727px;\">\r\n<p>F</p>\r\n</td>\r\n<td style=\"width: 140.909px;\">\r\n<p>F</p>\r\n</td>\r\n<td style=\"width: 126.364px;\">\r\n<p>F</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 428.182px; text-align: center;\">\r\n<p>3.</p>\r\n</td>\r\n<td style=\"width: 428.182px; text-align: center;\">\r\n<p>Disjunction</p>\r\n</td>\r\n<td style=\"width: 428.182px; text-align: center;\">\r\n<p>&nbsp;</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"66\">\r\n<p>A</p>\r\n</td>\r\n<td width=\"65\">\r\n<p>B</p>\r\n</td>\r\n<td width=\"58\">\r\n<p>(AvB)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"66\">\r\n<p>T</p>\r\n</td>\r\n<td width=\"65\">\r\n<p>T</p>\r\n</td>\r\n<td width=\"58\">\r\n<p>T</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"66\">\r\n<p>T</p>\r\n</td>\r\n<td width=\"65\">\r\n<p>F</p>\r\n</td>\r\n<td width=\"58\">\r\n<p>T</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"66\">\r\n<p>F</p>\r\n</td>\r\n<td width=\"65\">\r\n<p>T</p>\r\n</td>\r\n<td width=\"58\">\r\n<p>T</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"66\">\r\n<p>F</p>\r\n</td>\r\n<td width=\"65\">\r\n<p>F</p>\r\n</td>\r\n<td width=\"58\">\r\n<p>F</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 428.182px; text-align: center;\">\r\n<p>4.</p>\r\n</td>\r\n<td style=\"width: 428.182px; text-align: center;\">\r\n<p>Implication</p>\r\n</td>\r\n<td style=\"width: 428.182px; text-align: center;\">\r\n<p>&nbsp;</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"66\">\r\n<p>A</p>\r\n</td>\r\n<td width=\"65\">\r\n<p>B</p>\r\n</td>\r\n<td width=\"58\">\r\n<p>(A&rarr;B)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"66\">\r\n<p>T</p>\r\n</td>\r\n<td width=\"65\">\r\n<p>T</p>\r\n</td>\r\n<td width=\"58\">\r\n<p>F</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"66\">\r\n<p>T</p>\r\n</td>\r\n<td width=\"65\">\r\n<p>F</p>\r\n</td>\r\n<td width=\"58\">\r\n<p>F</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"66\">\r\n<p>F</p>\r\n</td>\r\n<td width=\"65\">\r\n<p>T</p>\r\n</td>\r\n<td width=\"58\">\r\n<p>T</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"66\">\r\n<p>F</p>\r\n</td>\r\n<td width=\"65\">\r\n<p>F</p>\r\n</td>\r\n<td width=\"58\">\r\n<p>F</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 428.182px; text-align: center;\">\r\n<p>5.</p>\r\n</td>\r\n<td style=\"width: 428.182px; text-align: center;\">\r\n<p>If and only if</p>\r\n</td>\r\n<td style=\"width: 428.182px; text-align: center;\">\r\n<p>&nbsp;</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"66\">\r\n<p>A</p>\r\n</td>\r\n<td width=\"65\">\r\n<p>B</p>\r\n</td>\r\n<td width=\"58\">\r\n<p>(A&harr;B)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"66\">\r\n<p>T</p>\r\n</td>\r\n<td width=\"65\">\r\n<p>T</p>\r\n</td>\r\n<td width=\"58\">\r\n<p>T</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"66\">\r\n<p>T</p>\r\n</td>\r\n<td width=\"65\">\r\n<p>F</p>\r\n</td>\r\n<td width=\"58\">\r\n<p>F</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"66\">\r\n<p>F</p>\r\n</td>\r\n<td width=\"65\">\r\n<p>T</p>\r\n</td>\r\n<td width=\"58\">\r\n<p>F</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"66\">\r\n<p>F</p>\r\n</td>\r\n<td width=\"65\">\r\n<p>F</p>\r\n</td>\r\n<td width=\"58\">\r\n<p>F</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>EQUIVALENT FORMS IN THE PROPOSITIONAL LOGIC</strong></p>\r\n<p>A1 and A2 are logically equal for each following interpretation:</p>\r\n<ol>\r\n<li>If A1 and A2 have the same truth values.</li>\r\n<li>A1 is true if and only if A2 is true and vice versa.</li>\r\n</ol>\r\n<p>~(D&rarr;F) = D ᴧ ~F</p>\r\n<p>Try to prove it for practice.</p>\r\n<table style=\"height: 1071px;\">\r\n<tbody>\r\n<tr style=\"height: 97px;\">\r\n<td style=\"text-align: center; height: 97px; width: 1284.55px;\" colspan=\"3\">\r\n<p><strong>Propositional Logic Equivalence Table</strong></p>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 97px;\">\r\n<td style=\"text-align: center; height: 97px; width: 201.818px;\">\r\n<p>S no</p>\r\n</td>\r\n<td style=\"text-align: center; height: 97px; width: 600px;\">\r\n<p>Equation</p>\r\n</td>\r\n<td style=\"text-align: center; height: 97px; width: 482.727px;\">\r\n<p>Comment</p>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 98px;\">\r\n<td style=\"text-align: center; height: 98px; width: 201.818px;\">\r\n<p>1.</p>\r\n</td>\r\n<td style=\"text-align: center; height: 98px; width: 600px;\">\r\n<p>(E&harr;G)=(E&rarr;G) ᴧ (G&rarr;E)</p>\r\n</td>\r\n<td style=\"text-align: center; height: 98px; width: 482.727px;\">\r\n<p>-</p>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 98px;\">\r\n<td style=\"text-align: center; height: 98px; width: 201.818px;\">\r\n<p>2.</p>\r\n</td>\r\n<td style=\"text-align: center; height: 98px; width: 600px;\">\r\n<p>(E&rarr;G) = ~E v G</p>\r\n</td>\r\n<td style=\"text-align: center; height: 98px; width: 482.727px;\">\r\n<p>-</p>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 97px;\">\r\n<td style=\"text-align: center; height: 97px; width: 201.818px;\">\r\n<p>3.</p>\r\n</td>\r\n<td style=\"text-align: center; height: 97px; width: 600px;\">\r\n<p>E v G = G v E</p>\r\n<p>E ᴧ G = G ᴧ E</p>\r\n</td>\r\n<td style=\"text-align: center; height: 97px; width: 482.727px;\">\r\n<p>Commutative law</p>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 97px;\">\r\n<td style=\"text-align: center; height: 97px; width: 201.818px;\">\r\n<p>4.</p>\r\n</td>\r\n<td style=\"text-align: center; height: 97px; width: 600px;\">\r\n<p>(E v G) v H = E v (G v H)</p>\r\n<p>(E ᴧ G) ᴧ H = E ᴧ (G ᴧ H)</p>\r\n</td>\r\n<td style=\"text-align: center; height: 97px; width: 482.727px;\">\r\n<p>Associative law</p>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 98px;\">\r\n<td style=\"text-align: center; height: 98px; width: 201.818px;\">\r\n<p>5.</p>\r\n</td>\r\n<td style=\"text-align: center; height: 98px; width: 600px;\">\r\n<p>E v (G ᴧ H) = (E v G) ᴧ (E v H)</p>\r\n<p>E ᴧ (G v H) = (E ᴧ G) v (E ᴧ H)</p>\r\n</td>\r\n<td style=\"text-align: center; height: 98px; width: 482.727px;\">\r\n<p>Distributive law</p>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 97px;\">\r\n<td style=\"text-align: center; height: 97px; width: 201.818px;\">\r\n<p>6.</p>\r\n</td>\r\n<td style=\"text-align: center; height: 97px; width: 600px;\">\r\n<p>E v False = E</p>\r\n</td>\r\n<td style=\"text-align: center; height: 97px; width: 482.727px;\">\r\n<p>-</p>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 97px;\">\r\n<td style=\"text-align: center; height: 97px; width: 201.818px;\">\r\n<p>7.</p>\r\n</td>\r\n<td style=\"text-align: center; height: 97px; width: 600px;\">\r\n<p>E v True = True</p>\r\n</td>\r\n<td style=\"text-align: center; height: 97px; width: 482.727px;\">\r\n<p>-</p>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 97px;\">\r\n<td style=\"text-align: center; height: 97px; width: 201.818px;\">\r\n<p>8.</p>\r\n</td>\r\n<td style=\"text-align: center; height: 97px; width: 600px;\">\r\n<p>~(~E) = E</p>\r\n</td>\r\n<td style=\"text-align: center; height: 97px; width: 482.727px;\">\r\n<p>-</p>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 98px;\">\r\n<td style=\"text-align: center; height: 98px; width: 201.818px;\">\r\n<p>9.</p>\r\n</td>\r\n<td style=\"text-align: center; height: 98px; width: 600px;\">\r\n<p>~(E v G) = ~E ᴧ ~G</p>\r\n<p>~(E ᴧ G) = ~E v ~G</p>\r\n</td>\r\n<td style=\"text-align: center; height: 98px; width: 482.727px;\">\r\n<p>De Morgan&rsquo;s law</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>NORMAL FORMS:</strong></p>\r\n<ol>\r\n<li><strong>CNF (Conjunctive Normal Form): </strong>A wff is a conjunctive normal form if and only if &lsquo;F&rsquo; has the form &lsquo;F1 ᴧ F2 ᴧ &hellip; ᴧ Fn&rsquo; n&gt;1 and F1 can be any wff such as (E v G) ᴧ (E ᴧ G), etc. For example:</li>\r\n</ol>\r\n<p>F: (E v G) ᴧ (E ᴧ T) ᴧ ((E ᴧ G)&rarr;A)</p>\r\n<ol start=\"2\">\r\n<li><strong>DNF (Disjunctive Normal Form): </strong>A wff G is a disjunctive normal form if and only if G has forms such as mentioned below :</li>\r\n</ol>\r\n<p>G: (E ᴧ G) v (E ᴧ T) v ((E ᴧ G)&rarr;A)</p>\r\n<p>To convert the formula into DNF, please follow the simple steps mentioned below:</p>\r\n<ol>\r\n<li>Remove the logical operators &lsquo;&harr;&rsquo;,&rsquo;&rarr;&rsquo;\r\n<ol>\r\n<li>(E&harr;G)=(E&rarr;G) ᴧ (G&rarr;E)</li>\r\n<li>(E&rarr;G) = ~E v G</li>\r\n</ol>\r\n</li>\r\n<li>Remove &lsquo;~&rsquo; if occur consecutively more than once:\r\n<ol>\r\n<li>~(~E) = E</li>\r\n<li>~(E v G) = ~E ᴧ ~G</li>\r\n<li>~(E ᴧ G) = ~E v ~G</li>\r\n</ol>\r\n</li>\r\n<li>Apply distributive law\r\n<ol>\r\n<li>E v (G ᴧ H) = (E v G) ᴧ (E v H)</li>\r\n<li>E ᴧ (G v H) = (E ᴧ G) v (E ᴧ H)</li>\r\n</ol>\r\n</li>\r\n</ol>', '<p><strong>DEMAND AND SUPPLY RULE OF ECONOMICS</strong></p>\r\n<p>For example, one stock coordinators are interested in finding the possibilities of demand and supply among all situations. As we know demand and supply behaves scatter in different situations.</p>\r\n<p>If price increases then demand reduces and vice-versa. If price increase then supply improves. In conclusion, if demand increases then supply decreases.&nbsp;</p>\r\n<p>A: Demand goes up</p>\r\n<p>B: Supply goes down</p>\r\n<p>U: Suppliers are not happy</p>\r\n<p>The problem has the following four statements:</p>\r\n<ol>\r\n<li>If the demand goes up then the supply does down.</li>\r\n<li>If supply goes down, suppliers are not happy.</li>\r\n<li>The demand goes up.</li>\r\n<li>Suppliers are not happy.</li>\r\n</ol>\r\n<p>The above-mentioned statements are symbolised as:</p>\r\n<ol>\r\n<li>A&rarr;B</li>\r\n<li>B&rarr;U</li>\r\n<li>A</li>\r\n<li>U (to conclusion)</li>\r\n</ol>\r\n<p>We have formed the formula according to the situation mentioned above. Please relate find out the meaning out of it:</p>\r\n<p>U is only possible if (A&rarr;B) ᴧ (B&rarr;U) ᴧ A</p>\r\n<p>Try to proof the given equation below for practice and interpret the conclusion</p>\r\n<p>((A&rarr;B) ᴧ (B&rarr;U) ᴧ A) = ((~A&rarr;B) ᴧ (~B&rarr;U) ᴧ A)</p><p>', '<p><strong>1. How does DNF differ from CNF? Transform the following well-formed formula into DNF:</strong></p>\r\n<p><strong style=\"color: #626262;\">(P&rarr; (~ (Q&rarr;R)))</strong></p>\r\n<p><strong>(P&rarr;Q) &rarr;~R</strong></p>\r\n<p>The wff is defined as a disjunctive normal form if and only if DNF has disjunction between statements and the same rule follows for CNF. DNF behaves opposite to CNF, try to proof with truth table for practice.</p>\r\n<p><strong> Solution to (P&rarr; (~ (Q&rarr;R)))</strong></p>\r\n<p>Step 1: Remove the logical operator</p>\r\n<p>=&gt;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;(~P v (~ (Q&rarr;R)))</p>\r\n<p>=&gt;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;(~P v (~ (~Q v R)))</p>\r\n<p>Step 2: Remove the negations</p>\r\n<p>=&gt;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;(~P v (~ (~Q) ᴧ (~R)))</p>\r\n<p>=&gt;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;(~P v (Q ᴧ ~R))</p>\r\n<p>We have got the required form <strong>(~P v (Q </strong><strong>ᴧ </strong><strong>~R))</strong></p>\r\n<p><strong> Try to solve second question for practice</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>2. Transform the following well-formed formula into CNF: </strong></p>\r\n<p><strong> (~A </strong><strong>ᴧ</strong><strong> B) v (A </strong><strong>ᴧ</strong><strong> ~B)</strong></p>\r\n<p><strong> (A&rarr;B)&rarr;C</strong></p>\r\n<p><strong> Solution to (~A </strong><strong>ᴧ</strong><strong> B) v (A </strong><strong>ᴧ</strong><strong> ~B)</strong></p>\r\n<p>=&gt;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;((~A ᴧ B) v A) ᴧ ((A ᴧ ~B) v ~B)</p>\r\n<p>=&gt;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;((A v ~A) ᴧ (A v B)) ᴧ ((~B v ~A) ᴧ (~B v B))</p>\r\n<p>=&gt;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;(TRUE ᴧ (A v B)) ᴧ ((~B v ~A) ᴧ TRUE)</p>\r\n<p>=&gt;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;(A v B) v (~B v ~A)</p>\r\n<p><strong> Try to solve second question for practice</strong></p>', '<ol>\r\n<li><a href=\"https://drive.google.com/file/d/0B1uwpw84VYSGS0pnVXRmYl9CX2s/view\">Block-1, MCSE003, IGNOU</a></li>\r\n<li><a href=\"https://www.youtube.com/watch?v=YMRO8i4-_q8&amp;list=PLmXKhU9FNesQxcibunbD82NTQMBKVUO1S\">Proposition | Discrete Mathematics | Knowledge Gate (Video)</a></li>\r\n<li><a href=\"https://www.youtube.com/watch?v=xlUFkMKSB3Y&amp;t=1s\">Proposition | NPTEL | MHRD (Video)</a></li>\r\n</ol>', 'Deepak', 'deepakkumaratariya@gmail.com', 1, NULL, '2019-09-29 16:28:25'),
(4, 68, 'Floating Point Arithmetic and Errors', '<p><strong>STAGES OF NUMERICAL COMPUTATION</strong></p>\r\n<ol>\r\n<li>Prepare the <strong>mathematical model</strong> using <strong>mathematical concepts</strong></li>\r\n<li>Create a <strong>numerical method(s)</strong> <strong>based on the model</strong></li>\r\n<li><strong>Implement the method(s) </strong>with the help of <strong>computer and software</strong> and <strong>compute the solution</strong></li>\r\n<li>Check the <strong>validity of the solution</strong>; if it is <strong>correct</strong>, it can be <strong>used</strong>, otherwise, the <strong>model needs to be modified or the method may have to be changed or the algorithm may have to be improved.</strong></li>\r\n</ol>\r\n<p><strong>REPRESENTATIONS</strong></p>\r\n<ol>\r\n<li><strong>Scientific calculations</strong> are done by <strong>floating-point arithmetic</strong> in order to <strong>represent very large or very small numbers satisfactorily</strong></li>\r\n<li>There are <strong>2 formats</strong> to represent a number: <strong>Fixed point: </strong>numbers are represented by a<strong> fixed number of decimal places</strong>; <strong>Floating point: </strong>they have<strong> fixed number of the significant place</strong></li>\r\n<li><strong>Data can be transformed from one format to another. Conversion of the fixed-point number to floating-point number is called normalization. It is done to preserve the maximum number of information-carrying digits of numbers</strong></li>\r\n<li><strong>Position of the decimal point</strong> is determined by the <strong>powers of the base</strong> (10 in the case of decimal number). For example, <strong>1.68x10<sup>3</sup></strong></li>\r\n</ol>\r\n<p><strong>SCIENTIFIC NOTATION</strong></p>\r\n<ol>\r\n<li>A <strong>real number &lsquo;x&rsquo;</strong> is represented in scientific notation as:<br /><strong>x &nbsp; &nbsp; =&nbsp;&nbsp;&nbsp;&nbsp; &plusmn; (d</strong><strong><sub>1</sub></strong><strong>d</strong><strong><sub>2&hellip;&hellip;&hellip;..</sub></strong><strong>d</strong><strong><sub>n</sub></strong><strong>) x 10</strong><strong><sup>m</sup></strong><strong>, which is also denoted by fl(x)</strong></li>\r\n</ol>\r\n<ol start=\"2\">\r\n<li>A floating-point number is called a <strong>normalized floating-point number</strong> if <strong>d</strong><strong><sub>1</sub></strong><strong>&ne;0</strong> <strong>or else d</strong><strong><sub>2</sub></strong><strong>=d</strong><strong><sub>3</sub></strong><strong>=&hellip;&hellip;.=d</strong><strong><sub>n</sub></strong><strong>=0</strong></li>\r\n<li><strong>Exponent &lsquo;m&rsquo; is usually bounded in a range &ndash;M &lt; m &lt; M</strong></li>\r\n<li>In scientific notation, <strong>significant</strong> is a number that is <strong>always greater than 1 and less than 10<br /></strong><strong>Eg: - 1.23 x 10</strong><strong><sup>2</sup></strong> <strong>can also be written as 1.23E+2</strong></li>\r\n</ol>\r\n<ol start=\"5\">\r\n<li><strong>Standard normalized floating-point numbers have significand greater than or equal to 0.1 and always less than 1</strong></li>\r\n<li><strong>If fl(x)&ne;0, and m &ge; M, x is called &lsquo;overflow number&rsquo;</strong></li>\r\n<li><strong>If m &le; -M,&nbsp; x is called &lsquo;underflow number&rsquo;</strong></li>\r\n<li><strong>&lsquo;n&rsquo; in floating-point notation is called it\'s precision</strong></li>\r\n</ol>\r\n<p><strong>FLOATING-POINT ARITHMETIC</strong></p>\r\n<ol>\r\n<li><strong>Results</strong> generated <strong>after performing floating-point arithmetic</strong> <strong>may not be floating-point numbers of the same length</strong></li>\r\n<li><strong>Arithmetic operation results &ne; floating-point operation results</strong></li>\r\n<li><strong>If &theta; is one of the arithmetic operations and &theta;</strong><strong><sup>*</sup></strong><strong> is the corresponding floating-point operation,<br /></strong><strong>x&nbsp; &theta;&nbsp; y &nbsp; &ne;&nbsp;&nbsp; x&nbsp; &theta;*</strong><strong>y<br /></strong><strong style=\"font-family: Lato; font-size: 14px;\">However, &nbsp; x&nbsp; &theta;&nbsp; y&nbsp; =&nbsp; fl(x&nbsp; &theta;&nbsp; y)</strong></li>\r\n</ol>\r\n<p><strong>PROPERTIES OF FLOATING-POINT ARITHMETIC</strong></p>\r\n<ol>\r\n<li><strong>Not Associative<br /></strong><strong>( x&nbsp; +&nbsp; y) + z &nbsp; &ne;&nbsp; x + (y&nbsp; +&nbsp; z)<br /></strong><strong>(x&nbsp; .&nbsp; y)&nbsp; .&nbsp; z&nbsp;&nbsp;&nbsp; &ne;&nbsp; x&nbsp; .&nbsp; (y&nbsp; .&nbsp; z)</strong></li>\r\n<li><strong>Not Distributive<br /></strong><strong>x &nbsp; .&nbsp; (y&nbsp; +&nbsp; z)&nbsp;&nbsp; &ne; &nbsp; (x&nbsp;&nbsp; .&nbsp;&nbsp; y) + (x &nbsp; .&nbsp;&nbsp; z)</strong></li>\r\n</ol>\r\n<p><strong>SIGNIFICANT DIGITS</strong></p>\r\n<ol>\r\n<li>Primarily used for indicating the accuracy of a numerical value</li>\r\n<li><strong>Non-zero digits</strong> are <strong>always significant</strong></li>\r\n<li><strong>0s before other digits</strong> are <strong>not significant</strong></li>\r\n<li><strong>0s between other digits</strong> are <strong>always significant</strong></li>\r\n<li><strong>0s after other digits</strong> but <strong>behind a decimal</strong> point are <strong>significant</strong></li>\r\n<li><strong>0s at the end of a number</strong> are <strong>significant</strong> <strong>only if they are behind a decimal point</strong></li>\r\n<li>Accuracy and precision are closely related to significant digits</li>\r\n<li><strong>Accuracy: Number of significant digits in a value</strong></li>\r\n<li><strong>Precision: Number of decimal positions or the order of magnitude if the last digit in a value</strong></li>\r\n</ol>\r\n<p><strong>SIGNIFICANT DIGITS IN MULTIPLICATION/DIVISION/TRIGONOMETRIC FUNCTIONS <br /></strong>Number of significant digits in an answer should equal the least number of significant digits in any of the numbers being multiplied or divided</p>\r\n<p><strong>SIGNIFICANT DIGITS IN ADDITION/SUBTRACTION<br /></strong><strong>Number of decimal places</strong> should be the <strong>same</strong> as the <strong>least number of decimal places</strong> in <strong>any of the numbers added or subtracted</strong></p>\r\n<p><strong>TRUNCATION PROCESS</strong> INVOLVES 2 METHODS</p>\r\n<ol>\r\n<li><strong>Rounding&nbsp;</strong></li>\r\n<li><strong>Chopping</strong></li>\r\n</ol>\r\n<p><strong>WRONG-WAY OF WRITING SIGNIFICANT DIGITS</strong></p>\r\n<ol>\r\n<li><strong>Writing more digits than justified by the number of digits in data</strong></li>\r\n<li><strong>Rounding off to x digits in intermediate answer and writing y digits in the final answer</strong></li>\r\n</ol>\r\n<p><strong>TO AVOID LOSS OF SIGNIFICANT DIGITS IN AN ALGEBRAIC EXPRESSION, RATIONALIZE THE NUMBERS, OR CARRY MORE SIGNIFICANT DIGITS IN THE FLOATING-POINT NUMBERS IN DOUBLE PRECISION</strong></p>\r\n<p><strong>ERROR - INTRODUCTION</strong></p>\r\n<ol>\r\n<li><strong>Difference</strong> between the <strong>actual value and the approximate value</strong> obtained from experimental observation or numerical computation<br /><strong>E&nbsp; &nbsp; =&nbsp;&nbsp;&nbsp; x &nbsp; -&nbsp;&nbsp; xa</strong></li>\r\n</ol>\r\n<ol start=\"2\">\r\n<li><strong>The calculation has 2 parts &ndash; operand and operator</strong></li>\r\n<li><strong>Approximation to operands</strong> leads to <strong>propagated error</strong></li>\r\n<li><strong>Approximation to operators</strong> leads to <strong>generated error</strong></li>\r\n<li><strong>Difference</strong> between <strong>exact and approximate value</strong> gets <strong>amplified in subsequent calculations (propagated error)</strong></li>\r\n<li>There are <strong>changes in actual operations</strong> and <strong>operations performed by a computer</strong>. This difference <strong>gives errors in calculation</strong>, which is <strong>amplified in subsequent calculations(generated error)</strong></li>\r\n</ol>\r\n<p><strong>SOURCES OF ERROR</strong></p>\r\n<ol>\r\n<li><strong>Data input (input error)</strong> &ndash; input information is rarely exact, as it comes from experiments, and it has limited accuracy</li>\r\n<li><strong>Errors in algorithms (algorithmic error)</strong> &ndash; finite or infinite steps</li>\r\n<li><strong>Errors during computation (computational error)</strong> &ndash; in case of multiplication or division, when the number of digits is large, the number cannot be held fully in the register, so digits need to be discarded, which gives an error</li>\r\n</ol>\r\n<p><strong>TYPES OF ERROR</strong></p>\r\n<ol>\r\n<li><strong>Round-off errors:</strong> due to floating-point representation of initial data (leads to propagated errors</li>\r\n<li><strong>Finite digit arithmetic operation, which leads to generated errors</strong></li>\r\n<li><strong>Finite representation of inherently infinite process, which causes truncation errors</strong></li>\r\n</ol>\r\n<p><strong>In an algorithm, if small changes in initial data x lead to large errors in the value of f(x), the algorithm is unstable. Error and accuracy are inversely proportional to each other &ndash; lesser the error, more is the accuracy</strong></p>\r\n<p><strong>THE ERRORS USED FOR DETERMINATION OF ACCURACY ARE</strong></p>\r\n<ol>\r\n<li><strong>Absolute error (generally used): magnitude of the difference between true value x and approximate value xa = |x &ndash; xa|</strong></li>\r\n<li><strong>Relative error: ratio of absolute error and actual value = |x &ndash; xa|/ x</strong></li>\r\n<li><strong>Percentage error: 100 * <u>|x &ndash; xa|/x</u></strong></li>\r\n</ol>\r\n<p><strong>WAYS OF TRANSLATING A REAL NUMBER INTO A FLOATING-POINT NUMBER</strong></p>\r\n<ol>\r\n<li><strong>Rounding<br /></strong><strong>fl(5562) = 0.5 * 10</strong><strong><sup>4</sup></strong> <strong>chopped</strong></li>\r\n</ol>\r\n<ol start=\"2\">\r\n<li><strong>Chopping<br /></strong><strong>fl(5562) =0.6 * 10</strong><strong><sup>4</sup></strong> <strong>rounded</strong></li>\r\n</ol>\r\n<p><strong>RULES FOR ROUNDING OFF</strong> &ndash; WHEN WE WANT TO <strong>USE ONLY A CERTAIN NUMBER OF DIGITS AFTER THE DECIMAL POINT </strong>THAT NUMBER IS <strong>ROUNDED OFF TO THAT MANY DIGITS</strong>. A NUMBER IS ROUNDED OFF</p>\r\n<ol>\r\n<li><strong>If d</strong><strong><sub>n+1 </sub></strong><strong>&lt; 5, chop</strong></li>\r\n<li><strong>If d</strong><strong><sub>n+1 </sub></strong><strong>&gt; 5, d</strong><strong><sub>n </sub></strong><strong>= d</strong><strong><sub>n</sub></strong><strong> + 1</strong></li>\r\n<li><strong>If d</strong><strong><sub>n+1</sub></strong><strong> = 5 &amp; d</strong><strong><sub>n</sub></strong><strong> is odd, d</strong><strong><sub>n</sub></strong><strong> = d</strong><strong><sub>n</sub></strong><strong> + 1, else chop</strong></li>\r\n</ol>\r\n<p><strong>ROUND OFF ERROR DECREASES WHEN PRECISION INCREASES</strong></p>\r\n<p><strong>ROUND OFF ERROR &delta; IS RELATED TO X AS<br /></strong><strong>fl(x)&nbsp; = x(1 + &delta;)<br /></strong><strong>|&delta;| &lt; 0.5 * 10</strong><strong><sup>-(n-1)</sup></strong><strong> in case of rounding<br /></strong><strong>-10</strong><strong><sup>-(n-1) </sup></strong><strong>&lt; &delta; &le; 0 in case of chopping</strong></p>', '<pre>Will be available soon</pre>', '<p><strong>1. Let a = 0.41, b = 0.36 and c = 0.70. Prove (a &ndash; b)/c &nbsp; &ne; (a/c) &ndash; (b/c).<br /></strong>Using two decimal digit arithmetic with rounding we have,<br />(a &ndash;b)/c &nbsp; = 0.71 &times; 10<sup>&ndash;1</sup>&nbsp; and (a/c) &ndash; (b/c) &nbsp; =&nbsp; 0 .59 &ndash; 0.51 = 0.80 &times; 10<sup>&ndash;1<br /></sup>while true value of (a -b )/c &minus; = 0.071428 &hellip;.&nbsp;<br />Therefore, (a - b)/c&nbsp; &ne; (a/c) &ndash; (b/c)</p>\r\n<p><strong style=\"color: #626262;\">2. Round the number x = 2.2554 to three significant figures. Find the absolute error and the relative error<br /></strong>The rounded-off number is 2.25. The absolute error is 0.0054. The relative error is&nbsp; <br />&asymp; 0.0054/2.25 = 0.0024. The percentage error is 0.24%</p>\r\n<p>&nbsp;</p>', '<ol>\r\n<li>For more information kindly refer to the <strong>Revised</strong> IGNOU study material for MCSE004.</li>\r\n</ol>', 'Shrinkhla', 'shrinkhlashiromani@gmail.com', 1, NULL, '2019-10-03 06:36:41');
